import React, { Component } from 'react'

import './home.css'

export default class Home extends Component {
  render(){
    return(
      <div className = "container placement">
        <h1> Hi, I'm Fil. </h1>
        <br />
        <h3> I run bizdev at <a href = "pulley.com">Pulley</a>. I've been doing <a href = "/placeholder">judo</a> my entire life,  am an avid <a href = "placeholder">harmonica</a> player, and am trying to get better every day.</h3>
        <br />
        <h3>I put together this website to keep myself accountable and track what I'm doing to </h3>
      </div>
      )
  }
}
